import ReadStatusCell from '../ReadStatusCell';
import Immutable from 'immutable';

/**
 * The ReadStatusCell Component cannot be testet, because it uses the connected method
 */

describe('The filterFunction', () => {
    it('return everytime false', () => {
        const value = Immutable.Map({
            icon: '/resources/icons/byname/csweb_check',
            tooltip: 'Erfolg'
        });
        const loweredText = 'folg';
        expect(ReadStatusCell.filterFunction(value, loweredText)).toBe(false);
    });
});